  return (
    <div className="container">
      {quizList.map((item) => (
        <QuizItem
          key={item.id}
          title={item.title}
          passingScore={item.passingScore}
          description={item.description}
          onDelete={() => {}}
          onEdit={() => {}}
        />
      ))}
      <Button variant="contained">Contained</Button>
    </div>
  );
};
export default QuizTab;
